<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>HSTC Fleet Fuel Analytics 2025</title>
<script src="https://cdn.tailwindcss.com"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/Chart.js/4.4.1/chart.umd.min.js"></script>
<script>tailwind.config={theme:{extend:{colors:{hg:'#1B6B37',hd:'#0f1f0f',hr:'#C41E3A',ha:'#15803d'}}}}</script>
<style>
@import url('https://fonts.googleapis.com/css2?family=IBM+Plex+Sans:wght@300;400;500;600;700&family=JetBrains+Mono:wght@400;500&display=swap');
*{font-family:'IBM Plex Sans',sans-serif;margin:0;box-sizing:border-box}
.mn{font-family:'JetBrains Mono',monospace}
::-webkit-scrollbar{width:4px;height:4px}
::-webkit-scrollbar-thumb{background:#1B6B37;border-radius:4px}
.ni{cursor:pointer;transition:all .15s;border-left:3px solid transparent;letter-spacing:.01em}
.ni:hover{background:rgba(255,255,255,.08)}
.ni.on{background:rgba(27,107,55,.15);border-left-color:#C41E3A;color:#fff}
.tb{cursor:pointer;transition:all .12s;padding:8px 16px;border-radius:8px;font-size:13px;font-weight:500;color:#6b7280;background:#f9fafb;border:1px solid #e5e7eb}
.tb:hover{background:#f0fdf4;color:#166534;border-color:#bbf7d0}
.tb.on{background:#1B6B37;color:#fff;border-color:#1B6B37;box-shadow:0 2px 8px rgba(27,107,55,.25)}
.kpi{transition:all .15s;border-radius:12px}.kpi:hover{transform:translateY(-1px);box-shadow:0 4px 12px rgba(0,0,0,.06)}
.fade{animation:fi .2s ease-out}@keyframes fi{from{opacity:0}to{opacity:1}}
canvas{max-height:340px}
table th{position:sticky;top:0;z-index:5}
.al-h{border-left:4px solid #dc2626;background:linear-gradient(135deg,#fef2f2,#fff)}
.al-m{border-left:4px solid #f59e0b;background:linear-gradient(135deg,#fffbeb,#fff)}
.al-i{border-left:4px solid #2563eb;background:linear-gradient(135deg,#eff6ff,#fff)}
.st-e{color:#059669;background:#ecfdf5}.st-r{color:#1e40af;background:#eff6ff}.st-m{color:#d97706;background:#fffbeb}.st-v{color:#dc2626;background:#fef2f2}.st-n{color:#9ca3af;background:#f9fafb}
.tc{font-size:9px;font-weight:700;padding:2px 6px;border-radius:4px;letter-spacing:.03em}
.tc-c{background:#dcfce7;color:#166534}.tc-s{background:#dbeafe;color:#1e40af}.tc-n{background:#f3f4f6;color:#6b7280}
.dq-h{color:#059669}.dq-m{color:#d97706}.dq-l{color:#dc2626}
.rng{position:relative;height:8px;background:#f1f5f9;border-radius:99px;overflow:visible;min-width:80px}
.rng-fill{position:absolute;height:100%;border-radius:99px;background:linear-gradient(90deg,#bfdbfe,#93c5fd);top:0}
.rng-dot{position:absolute;width:10px;height:10px;border-radius:99px;top:-1px;transform:translateX(-5px);border:2px solid #fff;box-shadow:0 1px 3px rgba(0,0,0,.2)}
.card{background:#fff;border-radius:12px;border:1px solid #e5e7eb;box-shadow:0 1px 3px rgba(0,0,0,.04)}
.card-t{padding:14px 18px;border-bottom:1px solid #f3f4f6;font-size:14px;font-weight:600;color:#374151}
tr:hover td{background:#f9fafb}
</style>
</head>

function fRec(data){return data.filter(r=>{
  if(F.c&&r[2]!==F.c)return false;if(F.t&&r[10]!==F.t)return false;
  if(F.l&&r[9]!==F.l)return false;if(F.k&&r[8]!==F.k)return false;
  if(F.f&&!r[3].toUpperCase().includes(F.f))return false;
  if(F.m){const m=parseInt(r[0].split('/')[1]);if(m!==+F.m)return false}
  return true;
})}
function fFleet(data){return data.filter(r=>{
  if(F.c&&r.category!==F.c)return false;if(F.t&&r.tier!==F.t)return false;
  if(F.l&&!r.locations.includes(F.l))return false;
  if(F.f&&!r.fleet_id.toUpperCase().includes(F.f))return false;
  return true;
})}

function debounce(fn,ms){let t;return function(...a){clearTimeout(t);t=setTimeout(()=>fn.apply(this,a),ms)}}

function applyF(){F.c=document.getElementById('fc').value;F.t=document.getElementById('ft').value;F.l=document.getElementById('fl').value;F.k=document.getElementById('fk').value;F.f=document.getElementById('ff').value.trim().toUpperCase();F.m=document.getElementById('fm').value;render()}

// Range visual: a thin bar showing where the median sits within the benchmark range
function rangeVis(med,lo,hi){
  if(!med||!lo||!hi)return'<span class="text-gray-300">‚Äî</span>';
  const maxV=Math.max(med*1.2,hi*1.2);
  const loP=(lo/maxV*100).toFixed(1),hiP=(hi/maxV*100).toFixed(1),medP=(med/maxV*100).toFixed(1);
  const c=med<=hi?'#22c55e':(med<=hi*1.15?'#f59e0b':'#ef4444');
  return`<div class="rng" title="Your fleet: ${med} | Industry: ${lo}‚Äì${hi}">
    <div class="rng-fill" style="left:${loP}%;width:${(hiP-loP).toFixed(1)}%"></div>
    <div class="rng-dot" style="left:${medP}%;background:${c}"></div></div>`;
}

  return`

    <div class="card p-5">
      <div class="flex items-center gap-2 mb-3"><span class="text-lg">1Ô∏è‚É£</span><span class="font-semibold text-green-800">Input Cleaning</span></div>
      <div class="text-[12px] text-gray-600 space-y-1">
        <div class="flex justify-between"><span>Raw records</span><span class="mn font-semibold">${fmt(q.total_raw)}</span></div>
        <div class="flex justify-between"><span>After cleaning</span><span class="mn font-semibold text-green-700">${fmt(q.valid_records)}</span></div>
        <div class="border-t border-gray-100 pt-1 mt-1 text-[11px] text-gray-400">
          Removed: ${q.garbage_excluded} garbage (B/OTHER) ¬∑ ${q.invalid_excluded} invalid<br>
          Reclassified: ${q.reclassified} (FUEL TANK ‚Üí TANKER)<br>
          Odometer 0.01 placeholder ‚Üí treated as missing (${fmt(q.odo_placeholder)})
        </div>
      </div>
    </div>
    <div class="card p-5">
      <div class="flex items-center gap-2 mb-3"><span class="text-lg">2Ô∏è‚É£</span><span class="font-semibold text-blue-800">Odometer Fixes</span></div>
      <div class="text-[12px] text-gray-600 space-y-1">
        <div class="flex justify-between"><span>High confidence</span><span class="mn font-semibold text-green-700">${fmt(q.corrections_high)}</span></div>
        <div class="flex justify-between"><span>Medium confidence</span><span class="mn font-semibold text-amber-600">${fmt(q.corrections_medium)}</span></div>
        <div class="flex justify-between"><span>Unfixable</span><span class="mn text-gray-400">${fmt(q.corrections_unfixable)}</span></div>
        <div class="border-t border-gray-100 pt-1 mt-1 text-[11px] text-gray-400">
          Method: prepend missing leading digits, validate against previous reading and reasonable distance
        </div>
      </div>
    </div>
    <div class="card p-5">
      <div class="flex items-center gap-2 mb-3"><span class="text-lg">3Ô∏è‚É£</span><span class="font-semibold text-purple-800">Consumption Calc</span></div>
      <div class="text-[12px] text-gray-600 space-y-1">
        <div class="flex justify-between"><span>Valid pairs</span><span class="mn font-semibold text-green-700">${fmt(q.consumption_valid)}</span></div>
        <div class="flex justify-between"><span>Excluded</span><span class="mn text-gray-400">${fmt(q.consumption_excluded)}</span></div>
        <div class="border-t border-gray-100 pt-1 mt-1 text-[11px] text-gray-400">
          Vehicles: (Fuel √∑ Distance) √ó 100 = L/100km<br>
          Equipment: Fuel √∑ Hours = L/hr<br>
          Excluded: impossible values, zero distance, flagged odometers
        </div>
      </div>
    </div>
  </div>
  <div class="card p-4 text-[11px] text-gray-500 leading-relaxed">
    <strong class="text-gray-700">Key decisions documented:</strong>
    "B" & "OTHER" categories (26 records) excluded as garbage data.
    FUEL TANK (43 records) merged into FUEL TANKER ‚Äî all were HSC-101 self-fueling.
    1,959 odometer entries with value 0.01 identified as placeholders and treated as missing, not zero.
    GENERATOR & STATIONARY PLANT have only 2‚Äì6% real odometer entries ‚Äî consumption data is limited for these.
  </div>`;
}

function dtabExplorer(){
  const recs=fRec(D.explorer);ep=0;
  return`<div class="card overflow-hidden">
    <div class="px-4 py-2.5 border-b flex items-center justify-between bg-gray-50/60">
      <div class="flex items-center gap-2">
        <button onclick="epNav(-1)" class="px-2.5 py-1 rounded-lg border border-gray-200 hover:bg-gray-100 text-gray-500 text-xs">‚Üê</button>
        <span id="ep-info" class="mn text-gray-400 text-[11px]"></span>
        <button onclick="epNav(1)" class="px-2.5 py-1 rounded-lg border border-gray-200 hover:bg-gray-100 text-gray-500 text-xs">‚Üí</button>
      </div>
      <button onclick="expCSV()" class="px-3 py-1.5 bg-hg text-white text-[11px] rounded-lg hover:bg-green-800 font-medium transition-colors">üì• Export CSV</button>
    </div>
    <div class="overflow-x-auto" id="exp-tbl">${expTblR(recs,0)}</div>
  </div>`;
}

function expTblR(recs,pg){
  const s=pg*EPP,sl=recs.slice(s,s+EPP);
  setTimeout(()=>{const i=document.getElementById('ep-info');if(i)i.textContent=`${s+1}‚Äì${Math.min(s+EPP,recs.length)} of ${fmt(recs.length)}`},0);
  return`<table class="w-full text-[12px]"><thead><tr class="bg-gray-50/80 text-[10px] text-gray-500 uppercase tracking-wider">
    <th class="px-3 py-2 text-left font-semibold">Date</th><th class="px-3 py-2 text-left font-semibold">Vehicle</th>
    <th class="px-3 py-2 text-left font-semibold">Category</th><th class="px-3 py-2 text-left font-semibold">Fleet</th>
    <th class="px-3 py-2 text-right font-semibold">Fuel</th><th class="px-3 py-2 text-right font-semibold">Odometer</th>
    <th class="px-3 py-2 text-left font-semibold">Tanker</th><th class="px-3 py-2 text-left font-semibold">Location</th>
    <th class="px-3 py-2 text-center font-semibold">Status</th>
  </tr></thead><tbody>${sl.map(r=>{
    const cor=r[11],flg=r[12];
    const badge=cor?'<span class="px-1.5 py-0.5 rounded text-[9px] font-semibold st-r">Fixed</span>':flg?'<span class="px-1.5 py-0.5 rounded text-[9px] font-semibold st-v">Flag</span>':'<span class="text-gray-300 text-[10px]">OK</span>';
    return`<tr class="border-t border-gray-100 ${flg?'bg-red-50/30':''}">
      <td class="px-3 py-1.5 mn text-gray-500">${r[0]}</td><td class="px-3 py-1.5 truncate max-w-[100px] text-gray-600" title="${r[1]}">${r[1]}</td>
      <td class="px-3 py-1.5 text-gray-600">${r[2]}</td><td class="px-3 py-1.5 mn font-medium text-hg">${r[3]}</td>
      <td class="px-3 py-1.5 mn text-right">${r[5]}</td><td class="px-3 py-1.5 mn text-right text-gray-500">${r[7]||r[6]||'-'}</td>
      <td class="px-3 py-1.5 text-gray-500">${r[8]}</td><td class="px-3 py-1.5 text-gray-500">${r[9]}</td>
      <td class="px-3 py-1.5 text-center">${badge}</td></tr>`}).join('')}</tbody></table>`}
function epNav(d){const recs=fRec(D.explorer);const pages=Math.ceil(recs.length/EPP);ep=Math.max(0,Math.min(pages-1,ep+d));document.getElementById('exp-tbl').innerHTML=expTblR(recs,ep)}
function expCSV(){
  const recs=fRec(D.explorer);
  const h='Date,Vehicle,Category,Fleet ID,Plate,Fuel,Odo Original,Odo Corrected,Tanker,Location,Tier,Corrected,Flagged\n';
  const rows=recs.map(r=>r.join(',')).join('\n');
  const blob=new Blob([h+rows],{type:'text/csv'});
  const a=document.createElement('a');a.href=URL.createObjectURL(blob);a.download='hstc_fuel_data.csv';a.click();
}

function dtabCorrections(){
  const corr=D.corrections.filter(c=>c.corrected);
  return`<div class="card overflow-hidden"><div class="overflow-x-auto"><table class="w-full text-[12px]">
    <thead><tr class="bg-gray-50/80 text-[10px] text-gray-500 uppercase tracking-wider">
      <th class="px-4 py-2.5 text-left font-semibold">Fleet</th><th class="px-3 py-2.5 text-left font-semibold">Date</th>
      <th class="px-3 py-2.5 text-left font-semibold">Category</th><th class="px-3 py-2.5 text-right font-semibold">Previous</th>
      <th class="px-3 py-2.5 text-right font-semibold">Entered</th><th class="px-3 py-2.5 text-right font-semibold">Corrected To</th>
      <th class="px-3 py-2.5 text-center font-semibold">Confidence</th>
    </tr></thead><tbody>${corr.slice(0,200).map(c=>`<tr class="border-t border-gray-100">
      <td class="px-4 py-2 mn font-medium text-hg">${c.fleet_id}</td><td class="px-3 py-2 mn text-gray-500">${c.date}</td>
      <td class="px-3 py-2 text-gray-600">${c.category}</td>
      <td class="px-3 py-2 text-right mn text-gray-400">${fmt(c.previous)}</td>
      <td class="px-3 py-2 text-right mn text-red-500 line-through">${fmt(c.original)}</td>
      <td class="px-3 py-2 text-right mn text-green-700 font-semibold">${fmt(c.corrected)}</td>
      <td class="px-3 py-2 text-center"><span class="px-2 py-1 rounded-md text-[10px] font-semibold ${c.confidence==='high'?'st-e':'st-m'}">${c.confidence}</span></td>
    </tr>`).join('')}</tbody></table></div>
    <div class="px-4 py-2.5 text-[11px] text-gray-400 border-t border-gray-100">Showing ${Math.min(200,corr.length)} of ${corr.length} corrections</div>
  </div>`;
}

document.addEventListener('DOMContentLoaded',()=>{initF();qt='summary';render()});
</script>
</body>
</html>
